import React from "react"
import NavItem from "./NavItem.js"
const NavBar = () => {
  return (
    <div>
      <NavItem name="Home" link="name1.com" />
      <NavItem name="My Complaints" link="name1.com" />
      <NavItem name="New Complaint" link="name1.com" />
      <NavItem name="Logout" link="name1.com" />
    </div>
  )
}

export default NavBar
